const styles = (theme) => ({
  hide: {
    display: 'none',
  },
  drawerPaper: ({ isFromDashboard }) => ({
    maxWidth: '3%',
    flexDirection: 'row',
    marginTop: isFromDashboard ? '3%' : 0,
    marginRight: isFromDashboard ? '15px' : 0,
  }),
  drawerPaperExpanded: ({ isFromDashboard }) => ({
    width: '20%',
    flexDirection: 'row',
    marginTop: isFromDashboard ? '3%' : 0,
  }),
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  },
});

export default styles;
